void sobel::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image1_address0\" :  \"" << image1_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image1_ce0\" :  \"" << image1_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"image1_q0\" :  \"" << image1_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image1_address1\" :  \"" << image1_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image1_ce1\" :  \"" << image1_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"image1_q1\" :  \"" << image1_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image2_address0\" :  \"" << image2_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image2_ce0\" :  \"" << image2_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image2_we0\" :  \"" << image2_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"image2_d0\" :  \"" << image2_d0.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

